import React, { Component } from 'react'

import OurTenets from './components/PageElements/OurTenets'
import Benefits from './components/PageElements/Benefits'
import FunEvents from './components/PageElements/FunEvents'
import SectionTitle from './components/PageElements/SectionTitle'

import Nav from './components/PageElements/Nav'
import FullHeightBanner from './components/PageElements/FullHeightBanner'
import JoinFlip from './components/PageElements/JoinFlip'
import OurCulture from './components/PageElements/OurCulture'

import 'bulma/css/bulma.css'
import './css/flip-careers.css'

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Nav />
        <FullHeightBanner />
        <JoinFlip />
        <OurCulture />
      </React.Fragment>
    )
  }
}
document.addEventListener('DOMContentLoaded', () => {
  // Get all "navbar-burger" elements
  const $navbarBurgers = Array.prototype.slice.call(
    document.querySelectorAll('.navbar-burger'),
    0
  )
  // Check if there are any navbar burgers
  if ($navbarBurgers.length > 0) {
    // Add a click event on each of them
    $navbarBurgers.forEach(el => {
      el.addEventListener('click', () => {
        // Get the target from the "data-target" attribute
        const target = el.dataset.target
        const $target = document.getElementById(target)

        // Toggle the "is-active" class on both the "navbar-burger" and the "navbar-menu"
        el.classList.toggle('is-active')
        $target.classList.toggle('is-active')
      })
    })
  }
})

export default App
